import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><path fill="#464646" d="M16 16H0V0h16v16z" /><path fill="#3C91AF" d="M1 1h14v14H1z" /><path fill="#147391" d="M10 1H6v9h4V1zM8 15c-1.4 0-2.5-1.1-2.5-2.5S6.6 10 8 10s2.5 1.1 2.5 2.5S9.4 15 8 15z" /><path fill="#FFF" d="M9 2v7H7V2h2" /><circle fill="#FFF" cx={8} cy={12.5} r={1.5} /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 16 16" xml:space="preserve">	<path fill="#464646" d="M16,16H0V0h16V16z"/><rect x="1" y="1" fill="#3C91AF" width="14" height="14"/>	<path fill="#147391" d="M10,1H6v9h4V1L10,1z"/>	<path fill="#147391" d="M8,15c-1.4,0-2.5-1.1-2.5-2.5S6.6,10,8,10s2.5,1.1,2.5,2.5S9.4,15,8,15z"/><polyline fill="#FFFFFF" points="9,2 9,9 7,9 7,2 9,2 "/><circle fill="#FFFFFF" cx="8" cy="12.5" r="1.5"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
